import React from "react";
import { Link } from "react-router-dom";
import "./Header.css";

function Header() {
  return (
    <div className="header">
      <Link to="/">
        <img
          className="header__logo"
          src="https://cdn.worldvectorlogo.com/logos/amazon-com-light.svg"
          alt="Amazon logo"
        />
      </Link>
    </div>
  );
}

export default Header;
